import React, {Component} from 'react';
import './Button.css';

class Button extends Component {
    render() {
        const { text, width, color } = this.props;

        return (
            <button style={{width: width, backgroundColor: color}}>
                {text}
            </button>
        )
    }
}

export default Button;
